  return (
    <div className='heading'>
      <h3>Title</h3>
      <p>Lorem ipsum dolor sit, amet consectetur adipisicing elit. Atque in exercitationem ratione sunt iusto magni ab eius vel quo. Autem, doloribus quibusdam provident quos velit maiores unde numquam expedita. Doloribus tempore quis error laboriosam magnam dignissimos obcaecati commodi natus porro expedita temporibus, aut corrupti quas, aliquid numquam alias aperiam ut!</p>
    </div>
  );
}
function YoutubeItem(props){
  return(
    <div className='youtube-item'>
      <div className='header'>
        <img src={props.imgHeader}/>
      </div>
      <div className='footer'>
        <img className='' src={props.imgAvatar}/>
        <div className='content'>
          <h3 className='title'>{props.title}</h3>
          <p className='time'>{props.time}</p>
        </div>
      </div>
    </div>
  );
}
function App() {
  return (
    <div>
    <YoutubeItem imgHeader="https://images.unsplash.com/photo-1644982652061-df82282e178d?ixlib=rb-1.2.1&ixid=MnwxMjA3fDF8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1470&q=80" imgAvatar="https://images.unsplash.com/photo-1656409450538-b1dd6777f70f?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=387&q=80" title="Day la hinh anh con gai xinh dep nguoi Nga" time="1 year ago"  ></YoutubeItem>
    </div>
  );
